import React, { useState, useEffect } from "react";
import { useSelector } from "react-redux"; // for accessing userType from Redux
import axios from "axios";
import Action1 from "../../../assets/icons/Action1.svg";
import AppointMentDetailModal from "./Modal/AppointMentDetailModal";

const AppointmentTable = () => {
  const [appointments, setAppointments] = useState([]);
  const [showModal, setShowModal] = useState(false);

  // Get userType and doctorId from Redux
  const userType = useSelector((state) => state.setUserType);
  const doctorId = useSelector((state) => state.auth.userId); // Assume doctorId is userId for doctors

  useEffect(() => {
    // Function to fetch appointments based on userType
    const fetchAppointments = async () => {
      try {
        let response;
        if (userType === 1) {
          // If userType is 1, get all appointments
          response = await axios.get(
            "http://localhost:8080/appointment/all-appointments"
          );
        } else if (userType === 2 && doctorId) {
          // If userType is 2, get appointments for a specific doctor based on doctorId
          response = await axios.get(
            `http://localhost:8080/doctor/${doctorId}/appointments`
          );
        }

        if (response) {
          setAppointments(response.data); // Assuming the response contains the appointments array
        }
      } catch (error) {
        console.error("Error fetching appointments:", error);
      }
    };

    fetchAppointments();
  }, [userType, doctorId]);

  const openModal = () => setShowModal(true);
  const closeModal = () => setShowModal(false);

  return (
    <div className="overflow-x-auto mx-5 my-5">
      <table className="min-w-full bg-white border border-gray-300">
        <thead>
          <tr className="bg-gray-100">
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              #
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Name
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Age
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Email
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Gender
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Department
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Date
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Time
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Doctor
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 ">
              Fees
            </th>
            <th className="px-6 py-3 border-b text-left text-sm font-bold text-gray-900 "></th>
          </tr>
        </thead>
        <tbody>
          {appointments.map((appointment, index) => (
            <tr key={appointment.id}>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {index + 1}
              </td>
              <td className="flex flex-row items-center mr-2 py-4 border-b text-sm text-gray-700 text-center">
                <img
                  src={
                    appointment.doctorImage || "https://via.placeholder.com/50"
                  }
                  alt="Doctor"
                  className="w-12 h-12 rounded-full mr-4"
                />
                {appointment.name}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {appointment.age}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {appointment.email}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {appointment.gender}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {appointment.department}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {appointment.date}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {appointment.time}
              </td>
              <td className="flex flex-row py-4 border-b items-center text-sm text-gray-700 text-center">
                <img
                  src={
                    appointment.doctorImage || "https://via.placeholder.com/50"
                  }
                  alt="Doctor"
                  className="w-12 h-12 rounded-full mr-4"
                />
                {appointment.doctor}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                {appointment.fees}
              </td>
              <td className="py-4 border-b text-sm text-gray-700 text-center">
                <div className="flex flex-row">
                  <img
                    src={Action1}
                    alt="Action"
                    onClick={openModal}
                    className="cursor-pointer"
                  />
                </div>
              </td>
            </tr>
          ))}
        </tbody>
      </table>

      <AppointMentDetailModal show={showModal} onClose={closeModal} />
    </div>
  );
};

export default AppointmentTable;
